import React from "react";

const About = () => {
  return (
    <div>
      <h1>About App</h1>
      <p className="my-1">Keep your contact</p>
      <p className="bg-dark p">
        <strong>Version: </strong> 1.0
      </p>
    </div>
  );
};

export default About;
